function chart(root, width, height, graphClass) {
  const svg = d3.select(graphClass);

  var format = d3.format(",d");
      // color = d3.scaleOrdinal(d3.schemeSet3)
      // floodScale = d3.scaleOrdinal().domain(["FLOOD","NEW SCHOOL","OTHER","PENET","ROOF","SANDY"])
      //               .range(["#111111","#222222","#333333","#444444","#555555","#666666"])
      //               .attr("fill", d => floodScale(d.group));
const color = d3.scaleOrdinal()
                  .domain(["FLOOD","NEW SCHOOL","OTHER","PENET","ROOF","SANDY"])
                  .range(["#f9d423","#cc208e","#dbdbdb","#469fe7","#00ecbc","#9D00C6"]); //, , , , , 
// const color = d3.scaleOrdinal(d3.schemeCategory10);

// #0AFB60
// #00FFED
// #dbdbdb
// #f9d423
// #FB36F4
// #9D00C6

// ////glow
// //Container for the gradients
// var defs = svg.append("defs");
// //Filter for the outside glow
// var filter = defs.append("filter")
//     .attr("id","glow");
// filter.append("feGaussianBlur")
//     .attr("stdDeviation","3.5")
//     .attr("result","coloredBlur");
// var feMerge = filter.append("feMerge");
// feMerge.append("feMergeNode")
//     .attr("in","coloredBlur");
// feMerge.append("feMergeNode")
//     .attr("in","SourceGraphic");



  var tooltip = d3.select("body").append("div")
    .style("position", "absolute")
    .style("z-index", "10")
    .style("visibility", "hidden")
    .style("color", "white")
    .style("padding", "8px")
    .style("background-color", "rgba(0, 0, 0, 0.75)")
    .style("border-radius", "6px")
    .style("font", "12px sans-serif")
    .text("tooltip");

  var bubble = d3.pack()
    .size([width, height])
    .padding(1.5);
     bubble(root);

  var node = svg.selectAll(".node")
      .data(root.children)
      .enter().append("g")
      .attr("class", "node")
      .attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; });
      // .style("filter", "url(#glow)");

  node.append("circle")
      .attr("r", function(d) { return d.r; })
      .style("fill", function(d) {
          return color(d.data.group);
      })
      // .style("fill", function(d) {
      //     return floodScale(d.data.group);
      // })
      .on("mouseover", function(d) {
          console.log(d.group);
          tooltip.text(d.data.name + ": " + "$" + format(d.data.budget) + " Type of Intervention:" + d.data.group);
          tooltip.style("visibility", "visible");
          // d3.select(this).style("#bubble")
          d3.select(this).style("stroke", "white");
      })
      .on("mousemove", function() {
          return tooltip.style("top", (d3.event.pageY-10)+"px").style("left",(d3.event.pageX+10)+"px");
      })
      .on("mouseout", function() {
        d3.select(this).style("stroke", "none");
        return tooltip.style("visibility", "hidden");
      });

  node.append("text")
      .attr("dy", ".3em")
      .style("text-anchor", "middle")
      .style("font", "10px sans-serif")
      .style("pointer-events", "none")
      //.text(function(d) { return d.data.name.substring(0, d.r / 3); });

}

