  function transformToGenericObjectList(flatData) {
    var container = {};
    container.children = [];
    var regionToCountry = {};
    flatData.forEach(entry => {
      if (entry["NOR_DATA"] !== "") {
        container.children.push({group: entry["TYPE"], budget: parseFloat(entry["TOTAL_BUDGET"]), value: parseFloat(entry["NOR_DATA"]), name: entry["SCH_NAME"]});
      } //budget: parseFloat(entry["TOTAL_BUDGET"]),
    });

  return container;
}

